Short Description:
এটি সম্পূর্ণ ওয়াটারপ্রুফ
প্রতি মিনিটে ১০ /১৫ লিটার এবং ঘন্টায় ৬০০/১০০০ লিটার পর্যন্ত পানি তুলতে পারে এই ওয়াটার পাম্প।
বিভিন্ন কৃষি কাজে ও খামার, ফুলের বাগান, গারি ধোয়ার কাজে, একুরিয়াম, বিভিন্ন মাছের হাউজে, কিংবা যে কোন শৌখিন কাজে ব্যবহার করতে পারেন।
৩০ ফিট উঁচু পর্যন্ত পানি তুলতে পারে।
পাম্পটি আপনি সোলার ও ১২ ভল্টের ব্যটারি বা পাওয়ার সাপ্লাই এর মাধ্যমে করেন্ট এ ও চালাতে পারবেন।
 Brushless DC motor, also known as EC motor; Magnetic Driven;
Small size but strong; Low consumption & High Efficiency;
 Long time continuous working, lifespan about 30000 hours;
 Safety – no spark, Explosion – Proof; Low noise about 40dB;
Submersible, 100% waterproof;
Wide range of working voltage; Maintenance – free;
 Can be used to pump water, oil, acid and alkali solution;
 Variety Power: DC electric source, Battery or Solar Panel;
Soft Start with Low in-rush current, great for the Solar System.

